return {
  type: "grammar",
  initializer: extractOptional(initializer, 0),
  rules: extractList(rules, 0),
  location: location()
};

return {
  type: "rule",
  name: name,
  expression: displayName !== null
    ? {
        type: "named",
        name: displayName[0],
        expression: expression,
        location: location()
      }
    : expression,
  location: location()
};

return tail.length > 0
  ? {
      type: "choice",
      alternatives: buildList(head, tail, 3),
      location: location()
    }
  : head;

return code !== null
  ? {
      type: "action",
      expression: expression,
      code: code[1],
      location: location()
    }
  : expression;

return tail.length > 0
  ? {
      type: "sequence",
      elements: buildList(head, tail, 1),
      location: location()
    }
  : head;

